		<script>
			var totalImgGrade = function(person) {
				var imgName;
				var description;
				var quality;
				var totalImgPx;
				if(person < 20) {
					imgName = "unqualified.png";
					quality = "不合格";
					totalImgPx = "2";
					description = "孩子的体质水平不合格，可能会严重影响孩子参与体育活动！";
				} else if(person >= 20 && person <= 27) {
					imgName = "qualified.png";
					quality = "合格";
					totalImgPx = "3";
					description = "孩子体质水平合格，但合格只是第一步，多运动，身体才更棒！";
				} else if(person >= 28 && person <= 31) {
					imgName = "favourable.png";
					quality = "良好";
					totalImgPx = "4";
					description = "孩子体质水平良好，培养孩子对体育活动的爱好是提升关键！";
				} else if(person >= 32) {
					quality = "优秀";
					imgName = "fine.png";
					totalImgPx = "5";
					description = "孩子体质水平优秀，从小就是“健力宝”，将来一定“可口可乐”！";
					imgName = "fine.png";
				}
				return {
					ImgName: imgName,
					Description: description,
					Quality: quality,
					TotalImgPx: totalImgPx
				};
			};
